import React, { useEffect, useState } from 'react';
import jwtDecode from 'jwt-decode';  // Make sure to install jwt-decode and import like this

function Dashboard() {
    const [userName, setUserName] = useState('');

    useEffect(() => {
        // Get the token from localStorage
        const token = localStorage.getItem('token');
        
        if (token) {
            // Decode the token to get user information
            const decodedToken = jwtDecode(token); // No errors should occur here
            setUserName(decodedToken.name); // Assuming the token contains 'name'
        }
    }, []);

    return (
        <div>
            <h1>Welcome, {userName}!</h1>
            <p>This is your personalized dashboard.</p>
        </div>
    );
}

export default Dashboard;
